package mypage;

public class MypassportDTO {
	
	private String name_kr;
	private String name_en;
	private String gender;
	private String phonenumber;
	private String exp_date;
	private String passport_num;
	private String reservation_rv_code;
	private String p_country;
	
	public MypassportDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getName_kr() {
		return name_kr;
	}

	public void setName_kr(String name_kr) {
		this.name_kr = name_kr;
	}

	public String getName_en() {
		return name_en;
	}

	public void setName_en(String name_en) {
		this.name_en = name_en;
	}

	public String getGender() {
		return gender;
	}

	public void setGender(String gender) {
		this.gender = gender;
	}

	public String getPhonenumber() {
		return phonenumber;
	}

	public void setPhonenumber(String phonenumber) {
		this.phonenumber = phonenumber;
	}

	public String getExp_date() {
		return exp_date;
	}

	public void setExp_date(String exp_date) {
		this.exp_date = exp_date;
	}

	public String getPassport_num() {
		return passport_num;
	}

	public void setPassport_num(String passport_num) {
		this.passport_num = passport_num;
	}

	public String getReservation_rv_code() {
		return reservation_rv_code;
	}

	public void setReservation_rv_code(String reservation_rv_code) {
		this.reservation_rv_code = reservation_rv_code;
	}

	public String getP_country() {
		return p_country;
	}

	public void setP_country(String p_country) {
		this.p_country = p_country;
	}
	
	
	
	
}//class

